value.scriptedProcessingTime:
(function getProcessingTime(dimObj) {
    var dtmLookUPFlag = dimObj.dtmFromTMO;
	if (typeof dimObj.stopOffs[1] == 'undefined') {
		return 1000000;
	}
	trasitTime = 999999999;
	if ((dimObj.stopOffs[0].stop.indexOf('TRANSPORT') > -1)
			|| ((dimObj.stopOffs[1] == 'undefined') || (dimObj.stopOffs[1].stop
					.indexOf('TRANSPORT') > -1))) {
		return 99999;
	}
	var sendingTimeFactor = 0 ;
	var receivingTimeFactor = 0 ;
	var finalloadthroughput = 0;
	finalloadthroughput = getFinalLoadThroughput(dimObj);
	if(isNaN(finalloadthroughput)){
		finalloadthroughput=0;
	}

	var finalunloadthroughput = 0;
	finalunloadthroughput = getFinalUnLoadThroughput(dimObj);
	if(isNaN(finalunloadthroughput)){
		finalunloadthroughput=0;
	}	

	try {
		
		 sendingTimeFactor = getAdditionalSendingActivityTime(dimObj) ;
		receivingTimeFactor = getAdditionalReceivingActivityTime(dimObj);
	    if(dtmLookUPFlag > 0){
			if(parseFloat(dimObj.transitTimeMatrix[stop1+'-'+stop2])) {
						trasitTime = finalloadthroughput + (parseFloat(dimObj.transitTimeMatrix[stop1+'-'+stop2]))
									+ finalunloadthroughput + sendingTimeFactor + receivingTimeFactor;
		 		}
		} else {
			
				if(transitTimeMatrix[stop1] && transitTimeMatrix[stop1][stop2]) {
					trasitTime = finalloadthroughput + transitTimeMatrix[stop1][stop2]
							+ finalunloadthroughput + sendingTimeFactor + receivingTimeFactor ;
				}	
		}
		
		
		if (isNaN(trasitTime)) {
			warn('Error Calculating Transit Time for' + stop1 + '-- ' + stop2);
			return 999999999;
		}
	} catch (err) {
		warn('Error calculating processing time -- ' + err.message);
		return 999999999;
		
	}
	return (trasitTime);
})

